import React from "react";

const Footer = () => {
  return (
    <div>
      <footer className="w-100 bg-light text-center">
        <p>
          ©️ 2024 Shreya Sharma.All Rights Reserved | Terms and Conditions
          
        </p>
      </footer>
    </div>
  );
};

export default Footer;
